(218, 'edd_sl_5e154b635ebb055b20bf1aef7efff963', 'a:2:{s:7:\"timeout\";i:1604988469;s:5:\"value\";s:40936:\"{\"new_version\":\"1.4.6\",\"stable_version\":\"1.4.6\",\"name\":\"Cardinal Locator Single License\",\"slug\":\"cardinal-locator\",\"url\":\"https:\\/\\/cardinalwp.com\\/downloads\\/cardinal-locator-single-license\\/?changelog=1\",\"last_updated\":\"2019-12-09 08:15:52\",\"homepage\":\"https:\\/\\/cardinalwp.com\",\"package\":\"\",\"download_link\":\"\",\"sections\":{\"description\":\"<p>Cardinal Store Locator is a WordPress plugin that gives customers the ability to add a fully functional locator to a WordPress website. It is built on top of the <a href=\\\"https:\\/\\/github.com\\/bjorn2404\\/jQuery-Store-Locator-Plugin\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">jQuery Store Locator plugin<\\/a> and offers all of the same features as the jQuery plugin along with a WordPress dashboard settings page, the ability to add locations as a custom post type or other data source of your choosing and set up filtering based on taxonomies. The plugin is aimed at developers with the amount of options and functionality available, but is accessible enough for non-developers to understand.<\\/p>\\n\",\"changelog\":\"<p><strong>1.4.6<\\/strong><\\/p>\\n<ul>\\n<li>Fixed missing CSS property .loc-alt-dist needed for front-end distance swap - both KM and miles show in templates without.<\\/li>\\n<li>Removed Geocoding API from being sent to the JS file (no longer publicly viewable in page source).<\\/li>\\n<li>Updated Handlebars templates so that location names are output with triple stash to avoid special character issues.<\\/li>\\n<li>Updated remote data caching functionality so that it\'s skipped completely if a relative URL is used for the Data file path setting.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.5<\\/strong><\\/p>\\n<ul>\\n<li>Added [cardinal-storelocator-address] shortcode to display single location address.<\\/li>\\n<li>Added bh_sl_locations_query_args filter to allow location WP_Query arguments to be updated\\/overridden.<\\/li>\\n<li>Added bh_sl_tax_cpts filter to allow the default \\\"Location Categories\\\" taxonomy to be applied to other post types.<\\/li>\\n<li>Added cslAjaxData callback to allow custom data to be sent with the AJAX request.<\\/li>\\n<li>Added cslAutoGeoSuccess callback that fires after the geolocation API returns a successful result.<\\/li>\\n<li>Added cslFormVals callback that fires after the form values have been processed from the form.<\\/li>\\n<li>Added cslGeocodeRestrictions callback that allows the componentRestrictions object to be overridden.<\\/li>\\n<li>Added cslNearestLoc callback that fires when the nearest location is triggered with the open nearest setting.<\\/li>\\n<li>Added cslSorting callback that fires when when a new sorting method is selected.<\\/li>\\n<li>Added component filtering for geocoding to better restrict by area - especially helpful with international geocoding.<\\/li>\\n<li>Added custom sorting settings under Structure Settings to allow visitors to control the location sort order from the front-end.<\\/li>\\n<li>Added drag and drop order functionality to filters set up under Filter Settings.<\\/li>\\n<li>Added functionality to specify filter types using the [cardinal-storelocator-filters] shortcode with the filter-types attribute.<\\/li>\\n<li>Added functionality to fill in search input with determined address when using Auto geocode or Geocode button settings.<\\/li>\\n<li>Added length unit (distance miles\\/kilometers) front-end swap functionality and settings.<\\/li>\\n<li>Added geocoding back-end API key field setting when Data source is set to Register Locations Post Type or Other Custom Post Type.<\\/li>\\n<li>Added Google Map object as parameter to cslBeforeSend, cslListClick, cslModalReady, and cslFilters callbacks.<\\/li>\\n<li>Added location data object as parameter of cslDirectionsRequest callback.<\\/li>\\n<li>Added mappingObject, originPoint, data, and page parameters to cslSuccess callback.<\\/li>\\n<li>Added \\\"No results alternative\\\" setting to display the no results message instead of all locations when the closest location is further than the \\\"Distance alert\\\" setting.<\\/li>\\n<li>Added open nearest location setting to automatically highlight the closest location from the origin.<\\/li>\\n<li>Changed parseJSON to native JSON.parse due to deprecation in rawData processing function.<\\/li>\\n<li>Fixed full path disclosure security issue with data passed to JavaScript.<\\/li>\\n<li>Fixed issue where HTML5 Geolocation was skipped when using the fullMapStartBlank setting.<\\/li>\\n<li>Fixed issue with featuredLocations setting where featured locations at far distances would trigger distance alert.<\\/li>\\n<li>Fixed issue with filtering values containing ampersands, which would not display any results - updated filtering regex.<\\/li>\\n<li>Fixed issue with mapReload (triggered with optional reset button) where store limit wasn\'t reset.<\\/li>\\n<li>Fixed issue with pagination page numbers displaying after no results.<\\/li>\\n<li>Fixed issue with taxonomy filtering and autoGeocode setting where HTML Geocoding API would run on every filter change.<\\/li>\\n<li>Fixed missing Google Maps API key parameter from post geocoding call.<\\/li>\\n<li>Fixed variable casting warning in PHP v7.1+ in shortcode file with wp_localize_script.<\\/li>\\n<li>Fixed typo in admin meta box container ID \\\"locations_meta_box\\\".<\\/li>\\n<li>Removed check for safe mode in plugin Support settings tab since it is deprecated as of PHP 5.4.0.<\\/li>\\n<li>Renamed EDD updater class to avoid conflicts with other themes and plugins.<\\/li>\\n<li>Removed locations transient (bh_sl_locations) expiration to default to none.<\\/li>\\n<li>Updated taxonomy filtering so pagination is reset to first page after selecting a filter.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.4<\\/strong><\\/p>\\n<ul>\\n<li>Hotfix to add now required key parameter to location post geocoding API call.<\\/li>\\n<li>This is just a quick fix - larger update with v1.4.5 coming very soon.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.3<\\/strong><\\/p>\\n<ul>\\n<li>Fixed error when filtering with query strings where filter values with spaces wouldn\'t work.<\\/li>\\n<li>Updated processForm method so submitting the map removes focus from any of the form input\\/select fields instead of just the address input.<\\/li>\\n<li>Updated filterData string replace methods to match string replace method in filters setup.<\\/li>\\n<li>Updated WPML path modification method so that it only is applied when \\\"A different domain per language\\\" is set as the language URL format.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.2<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to indicate multiple query string parameter values (for checkboxes) with a comma separated list value.<\\/li>\\n<li>Added additional hours meta fields for a total of seven to match days of the week.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/filters\\/plugin-assets-filter\\/\\\">bh_sl_page_check filter<\\/a> to disable locator scripts and styles on indicated pages.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/filters\\/taxonomy-filters-value-filter\\/\\\">bh_sl_filter_vals_\\\"taxonomy\\\" filter<\\/a> so filter values can be modified prior to output.<\\/li>\\n<li>Added blur to primary location input field after form submission to hide mobile keyboards.<\\/li>\\n<li>Added check to exclusive filtering to make sure filter values are not undefined before proceeding with the regular expression.<\\/li>\\n<li>Added disable autocomplete listener setting to disable the listener that immediately triggers a search when an auto complete location option is selected.<\\/li>\\n<li>Added functionality to automatically select\\/check filters on load from query string parameter values.<\\/li>\\n<li>Added location details object to <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/javascript-callbacks\\/location-list-click-callback\\/\\\">cslListClick<\\/a> and <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/javascript-callbacks\\/marker-click\\/\\\">cslMarkerClick<\\/a> callbacks.<\\/li>\\n<li>Added structure setting to disable form tags.<\\/li>\\n<li>Added template URI and stylesheet URI as available variables to Handlebars templates.<\\/li>\\n<li>Added WordPress REST API support for default locations custom post type (bh_sl_locations).<\\/li>\\n<li>Fixed broken drag search functionality that was introduced after map scope pull request was merged from jQuery plugin.<\\/li>\\n<li>Fixed geocoding issue when using an alternative custom post type for locations.<\\/li>\\n<li>Fixed Handlebars targeting issue triggered by placing an unordered list within the location list template.<\\/li>\\n<li>Fixed issue with full map start where conditional was checking if isNaN was true when it should have been false on full map start list limit setting.<\\/li>\\n<li>Updated geocoding functionality to start saving Place IDs when available.<\\/li>\\n<li>Updated over 1,000 locations AJAX method to use float values instead of decimals for latitude and longitude coordinates.<\\/li>\\n<li>Updated zooming to prevent fitBounds from being used when query string parameters are in use and the location has been set with bh-sl-address.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.1<\\/strong><\\/p>\\n<ul>\\n<li>Added cslRegion callback, which allows region to be set before being sent to the Google Maps Geocoding API.<\\/li>\\n<li>Fixed admin scripts loading on all WordPress dashboard pages and related post object error.<\\/li>\\n<li>Fixed issue where searching by location name after searching by address, without a new address, didn\'t reset the origin.<\\/li>\\n<li>Fixed incorrect origin marker parameter order after code restructure.<\\/li>\\n<li>Fixed single map issues with info window content when using alternate custom post type for location data.<\\/li>\\n<li>Updated single map script so that global marker overrides are applied when using the shortcode and widget.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.4.0<\\/strong><\\/p>\\n<ul>\\n<li>Added checks to make sure filter values are skipped in shortcode output if the value isn\'t set.<\\/li>\\n<li>Added checks to replace non-ASCII characters when filtering to prevent issues with special characters.<\\/li>\\n<li>Added city column to Locations edit pages (list view).<\\/li>\\n<li>Added cslCreateMarker JS callback for custom marker overrides.<\\/li>\\n<li>Added Disable alpha markers setting.<\\/li>\\n<li>Added functionality to accept manual coordinate overrides with latitude and longitude post meta.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/github.com\\/googlemaps\\/js-info-bubble\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">InfoBubble<\\/a> support.<\\/li>\\n<li>Added location results total count if HTML element with \\\"bh-sl-total-results\\\" class exists.<\\/li>\\n<li>Added map preview post meta box on single location edit screen with manual coordinate fine-tuning available.<\\/li>\\n<li>Added query string parameter filter check so that results can be filtered with URL query strings.<\\/li>\\n<li>Added reset functionality that can be triggered via a button that has the CSS class \\\"bh-sl-reset\\\".<\\/li>\\n<li>Added single location shortcode and widget to display map of a single location on single location posts.<\\/li>\\n<li>Added span and class to checkbox and radio button labels in filter output with shortcode.<\\/li>\\n<li>Fixed issue with Google Maps settings filter (bh_sl_map_settings) not being applied with full map start blank and no results.<\\/li>\\n<li>Fixed issue with Maximum Distance and Query string parameters settings combination.<\\/li>\\n<li>Updated Distance alert setting so that it can be disabled.<\\/li>\\n<li>Re-structured some of the underlying jQuery code.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.13<\\/strong><\\/p>\\n<ul>\\n<li>Fixed issue reading optional custom map styles file with WordPress installed in a subdirectory.<\\/li>\\n<li>Fixed issue where custom post meta with the same values were skipped from being included in the location data.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.12<\\/strong><\\/p>\\n<ul>\\n<li>Added array of term objects for location output to Handlebars templates for each custom taxonomy assigned to the locations post type.<\\/li>\\n<li>Added bh_sl_before_location_query and bh_sl_after_location_query hooks.<\\/li>\\n<li>Added cslMapSet callback that fires after the map has been set up.<\\/li>\\n<li>Added file existence and valid JSON checks to custom map styles file path setting.<\\/li>\\n<li>Changed method of reading custom map styles file from wp_remote_fopen to file_get_contents.<\\/li>\\n<li>Fixed issue where locations without attributes set (ex: custom meta fields) could get the attribute values from prior locations.<\\/li>\\n<li>Fixed issue where pagination total number of pages was based on the full location set total instead of the storeLimit setting.<\\/li>\\n<li>Reverted bh_storelocator_posts_query returning JSON vs. array for backwards compatibility.<\\/li>\\n<li>Updated included Handlebars to v4.0.5.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.11<\\/strong><\\/p>\\n<ul>\\n<li>Added additional JS error handling when the plugin checks the closest location.<\\/li>\\n<li>Added additional information about Google Maps API key, which is <a href=\\\"http:\\/\\/googlegeodevelopers.blogspot.com\\/2016\\/06\\/building-for-scale-updates-to-google.html\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">now required for all new URLs<\\/a>.<\\/li>\\n<li>Added fax meta field to default location post type.<\\/li>\\n<li>Added listener for autoComplete change so that the search processes when a new place is selected.<\\/li>\\n<li>Fixed issue with combination of autoGeocode and originMarker settings.<\\/li>\\n<li>Fixed PHP notices that would trigger on non-posts (no post ID) from enqueue_scripts in public class.<\\/li>\\n<li>Fixed zoom issue with Search on map drag setting.<\\/li>\\n<li>Switched city and address variables to triple stash in Handlebars templates to avoid issues with foreign characters.<\\/li>\\n<li>Updated admin class to delete locations transient when Primary Settings are saved to re-generate when Data Source is changed.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.10<\\/strong><\\/p>\\n<ul>\\n<li>Added optional Google Maps API key setting under Primary Settings.<\\/li>\\n<li>Added query string parameters string and key\\/val pair array to bh_sl_gmap filter.<\\/li>\\n<li>Fixed compatibility issue with WPML when using multiple domains.<\\/li>\\n<li>Fixed wp_enqueue_script deps parameters in a couple of instances.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.9<\\/strong><\\/p>\\n<ul>\\n<li>Fixed undefined JS issue with previous update.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.8<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to override data path and type with shortcode attributes datapath and datatype.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.7<\\/strong><\\/p>\\n<ul>\\n<li>Fixed issue with geocoding region parameter.<\\/li>\\n<li>Fixed issue with Full map start list limit default setting. Switched -1 default to 0.<\\/li>\\n<li>Updated Tested up to WordPress version to 4.5.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.6<\\/strong><\\/p>\\n<ul>\\n<li>Added check for WP_DEBUG to trigger jQuery plugin debug mode if enabled.<\\/li>\\n<li>Added post ID variable to bh_sl_location_data filter.<\\/li>\\n<li>Fixed issue with category marker images in which not setting a marker image could cause display issues with all markers.<\\/li>\\n<li>Updated Over 1,000 location query to use custom database table.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.5<\\/strong><\\/p>\\n<ul>\\n<li>Fixed geocode encoding issue with hashes in address fields.<\\/li>\\n<li>Fixed issue with geocode error handling.<\\/li>\\n<li>Minor WP_Query call optimizations.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.4<\\/strong><\\/p>\\n<ul>\\n<li>Fixed hard-coded postmeta prefixes in bh_storelocator_posts_query_ajax method.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.3<\\/strong><\\/p>\\n<ul>\\n<li>Exposed jQuery plugin callbacks.<\\/li>\\n<li>Removed check from createMarker method that removed spaces from categories - created issues with categories that have spaces.<\\/li>\\n<li>Re-worked handling of no results.<\\/li>\\n<li>Updated createMarker method to ensure custom category marker images are converted to integers if strings are passed for dimensions.<\\/li>\\n<li>Updated autoGeocode and default location functionality so that max distance is applied on initial load.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.2<\\/strong><\\/p>\\n<ul>\\n<li>Added custom location table row count to system information support tab.<\\/li>\\n<li>Fixed issue where custom category images weren\'t being output correctly to the jQuery plugin.<\\/li>\\n<li>Fixed issue in which 0 couldn\'t be saved as a setting value.<\\/li>\\n<li>Fixed issue with Location Category images where URLs weren\'t inserted when the the Link URL was empty.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.1<\\/strong><\\/p>\\n<ul>\\n<li>Added license check to avoid update issues after site migration and URL change.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.0<\\/strong><\\/p>\\n<ul>\\n<li>Added bh_sl_location_data filter so location data can be manipulated if needed.<\\/li>\\n<li>Added new Search on map drag setting under Primary Settings, which does a new search after the map is dragged.<\\/li>\\n<li>Added new Geocode button setting under Structure Settings, which allows you to bind a button to the HTML geolocation API.<\\/li>\\n<li>Changed postal code sanitization filter so that letters are allowed instead of just integers.<\\/li>\\n<li>Fixed pagination jQuery bubbling issue.<\\/li>\\n<li>Fixed pagination issues with autoGeocode combination.<\\/li>\\n<li>Fixed issues with Full map start list limit setting in combination with a different store limit.<\\/li>\\n<li>Fixed issues with no results where clicking the marker would display data from the previous result and clicking the location list item would throw an error.<\\/li>\\n<li>Fixed issues with Visible markers list setting and location list background colors and selection.<\\/li>\\n<li>Minor PHP formatting updates.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.2.1<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to override lat\\/lng coordinates with \'latitude\' and \'longitude\' meta keys with default CPT.<\\/li>\\n<li>Added excerpt to output location data.<\\/li>\\n<li>Added featured image URL to output location data.<\\/li>\\n<li>Added filter bh_sl_featured_img for output featured image URL size.<\\/li>\\n<li>Added functionality to output any custom taxonomy values applied to the location data (this also fixed filtering with other custom taxonomies).<\\/li>\\n<li>Added functionality to insert coordinates into database when using the WordPress Importer plugin.<\\/li>\\n<li>Fixed issue where post data wasn\'t being reset in enqueue_scripts method.<\\/li>\\n<li>Fixed missing argument warning in bh_storelocator_check_db_table method.<\\/li>\\n<li>Fixed Postal typo in post meta label.<\\/li>\\n<li>Removed extra wp_clear_scheduled_hook from bh-store-locator-db.php that was left in from testing.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.2.0<\\/strong><\\/p>\\n<ul>\\n<li>Set up a new method for handling over 1,000 location posts with a custom, indexed database table.<\\/li>\\n<li>Set up functionality to migrate existing coordinates into the new table with wp_cron.<\\/li>\\n<li>Newly added or updated location posts will now send coordinates to the custom table.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.1.1<\\/strong><\\/p>\\n<ul>\\n<li>Fixed JS issue with new full map start location list limit where clicking on a marker that didn\'t have a list item displayed caused an error.<\\/li>\\n<li>Fixed jQuery issue with settings combination of inline directions and default location.<\\/li>\\n<li>Reverted jQuery change to new list limit so that it\'s always applied with full map start enabled.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.1.0<\\/strong><\\/p>\\n<ul>\\n<li>Added new selected marker image options to highlight clicked marker under style settings.<\\/li>\\n<li>Added Google Places autocomplete option under primary settings.<\\/li>\\n<li>Added full map start location list limit setting under primary settings.<\\/li>\\n<li>Increased location data transient expiration.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.0.2<\\/strong><\\/p>\\n<ul>\\n<li>Added permalink to output location data for use in Handlebars templates.<\\/li>\\n<li>Switched Handlebars templates so that the name uses triple-stash because data is already escaped (special characters).<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.0.1<\\/strong><\\/p>\\n<p>Removed code that temporarily hid the map and results, when there are no results, in favor of just displaying the no\\u00a0results message and empty map.<\\/p>\\n\"},\"banners\":{\"high\":\"\",\"low\":\"\"},\"icons\":\"a:0:{}\",\"stable_tag\":\"trunk\",\"license\":\"GPLv3 or later\",\"license_uri\":\"http:\\/\\/www.gnu.org\\/licenses\\/gpl-3.0.html\",\"tested\":\"4.9\",\"description\":[\"<p>Cardinal Store Locator is a WordPress plugin that gives customers the ability to add a fully functional locator to a WordPress website. It is built on top of the <a href=\\\"https:\\/\\/github.com\\/bjorn2404\\/jQuery-Store-Locator-Plugin\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">jQuery Store Locator plugin<\\/a> and offers all of the same features as the jQuery plugin along with a WordPress dashboard settings page, the ability to add locations as a custom post type or other data source of your choosing and set up filtering based on taxonomies. The plugin is aimed at developers with the amount of options and functionality available, but is accessible enough for non-developers to understand.<\\/p>\\n\"],\"changelog\":[\"<p><strong>1.4.6<\\/strong><\\/p>\\n<ul>\\n<li>Fixed missing CSS property .loc-alt-dist needed for front-end distance swap - both KM and miles show in templates without.<\\/li>\\n<li>Removed Geocoding API from being sent to the JS file (no longer publicly viewable in page source).<\\/li>\\n<li>Updated Handlebars templates so that location names are output with triple stash to avoid special character issues.<\\/li>\\n<li>Updated remote data caching functionality so that it\'s skipped completely if a relative URL is used for the Data file path setting.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.5<\\/strong><\\/p>\\n<ul>\\n<li>Added [cardinal-storelocator-address] shortcode to display single location address.<\\/li>\\n<li>Added bh_sl_locations_query_args filter to allow location WP_Query arguments to be updated\\/overridden.<\\/li>\\n<li>Added bh_sl_tax_cpts filter to allow the default \\\"Location Categories\\\" taxonomy to be applied to other post types.<\\/li>\\n<li>Added cslAjaxData callback to allow custom data to be sent with the AJAX request.<\\/li>\\n<li>Added cslAutoGeoSuccess callback that fires after the geolocation API returns a successful result.<\\/li>\\n<li>Added cslFormVals callback that fires after the form values have been processed from the form.<\\/li>\\n<li>Added cslGeocodeRestrictions callback that allows the componentRestrictions object to be overridden.<\\/li>\\n<li>Added cslNearestLoc callback that fires when the nearest location is triggered with the open nearest setting.<\\/li>\\n<li>Added cslSorting callback that fires when when a new sorting method is selected.<\\/li>\\n<li>Added component filtering for geocoding to better restrict by area - especially helpful with international geocoding.<\\/li>\\n<li>Added custom sorting settings under Structure Settings to allow visitors to control the location sort order from the front-end.<\\/li>\\n<li>Added drag and drop order functionality to filters set up under Filter Settings.<\\/li>\\n<li>Added functionality to specify filter types using the [cardinal-storelocator-filters] shortcode with the filter-types attribute.<\\/li>\\n<li>Added functionality to fill in search input with determined address when using Auto geocode or Geocode button settings.<\\/li>\\n<li>Added length unit (distance miles\\/kilometers) front-end swap functionality and settings.<\\/li>\\n<li>Added geocoding back-end API key field setting when Data source is set to Register Locations Post Type or Other Custom Post Type.<\\/li>\\n<li>Added Google Map object as parameter to cslBeforeSend, cslListClick, cslModalReady, and cslFilters callbacks.<\\/li>\\n<li>Added location data object as parameter of cslDirectionsRequest callback.<\\/li>\\n<li>Added mappingObject, originPoint, data, and page parameters to cslSuccess callback.<\\/li>\\n<li>Added \\\"No results alternative\\\" setting to display the no results message instead of all locations when the closest location is further than the \\\"Distance alert\\\" setting.<\\/li>\\n<li>Added open nearest location setting to automatically highlight the closest location from the origin.<\\/li>\\n<li>Changed parseJSON to native JSON.parse due to deprecation in rawData processing function.<\\/li>\\n<li>Fixed full path disclosure security issue with data passed to JavaScript.<\\/li>\\n<li>Fixed issue where HTML5 Geolocation was skipped when using the fullMapStartBlank setting.<\\/li>\\n<li>Fixed issue with featuredLocations setting where featured locations at far distances would trigger distance alert.<\\/li>\\n<li>Fixed issue with filtering values containing ampersands, which would not display any results - updated filtering regex.<\\/li>\\n<li>Fixed issue with mapReload (triggered with optional reset button) where store limit wasn\'t reset.<\\/li>\\n<li>Fixed issue with pagination page numbers displaying after no results.<\\/li>\\n<li>Fixed issue with taxonomy filtering and autoGeocode setting where HTML Geocoding API would run on every filter change.<\\/li>\\n<li>Fixed missing Google Maps API key parameter from post geocoding call.<\\/li>\\n<li>Fixed variable casting warning in PHP v7.1+ in shortcode file with wp_localize_script.<\\/li>\\n<li>Fixed typo in admin meta box container ID \\\"locations_meta_box\\\".<\\/li>\\n<li>Removed check for safe mode in plugin Support settings tab since it is deprecated as of PHP 5.4.0.<\\/li>\\n<li>Renamed EDD updater class to avoid conflicts with other themes and plugins.<\\/li>\\n<li>Removed locations transient (bh_sl_locations) expiration to default to none.<\\/li>\\n<li>Updated taxonomy filtering so pagination is reset to first page after selecting a filter.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.4<\\/strong><\\/p>\\n<ul>\\n<li>Hotfix to add now required key parameter to location post geocoding API call.<\\/li>\\n<li>This is just a quick fix - larger update with v1.4.5 coming very soon.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.3<\\/strong><\\/p>\\n<ul>\\n<li>Fixed error when filtering with query strings where filter values with spaces wouldn\'t work.<\\/li>\\n<li>Updated processForm method so submitting the map removes focus from any of the form input\\/select fields instead of just the address input.<\\/li>\\n<li>Updated filterData string replace methods to match string replace method in filters setup.<\\/li>\\n<li>Updated WPML path modification method so that it only is applied when \\\"A different domain per language\\\" is set as the language URL format.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.2<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to indicate multiple query string parameter values (for checkboxes) with a comma separated list value.<\\/li>\\n<li>Added additional hours meta fields for a total of seven to match days of the week.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/filters\\/plugin-assets-filter\\/\\\">bh_sl_page_check filter<\\/a> to disable locator scripts and styles on indicated pages.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/filters\\/taxonomy-filters-value-filter\\/\\\">bh_sl_filter_vals_\\\"taxonomy\\\" filter<\\/a> so filter values can be modified prior to output.<\\/li>\\n<li>Added blur to primary location input field after form submission to hide mobile keyboards.<\\/li>\\n<li>Added check to exclusive filtering to make sure filter values are not undefined before proceeding with the regular expression.<\\/li>\\n<li>Added disable autocomplete listener setting to disable the listener that immediately triggers a search when an auto complete location option is selected.<\\/li>\\n<li>Added functionality to automatically select\\/check filters on load from query string parameter values.<\\/li>\\n<li>Added location details object to <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/javascript-callbacks\\/location-list-click-callback\\/\\\">cslListClick<\\/a> and <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/javascript-callbacks\\/marker-click\\/\\\">cslMarkerClick<\\/a> callbacks.<\\/li>\\n<li>Added structure setting to disable form tags.<\\/li>\\n<li>Added template URI and stylesheet URI as available variables to Handlebars templates.<\\/li>\\n<li>Added WordPress REST API support for default locations custom post type (bh_sl_locations).<\\/li>\\n<li>Fixed broken drag search functionality that was introduced after map scope pull request was merged from jQuery plugin.<\\/li>\\n<li>Fixed geocoding issue when using an alternative custom post type for locations.<\\/li>\\n<li>Fixed Handlebars targeting issue triggered by placing an unordered list within the location list template.<\\/li>\\n<li>Fixed issue with full map start where conditional was checking if isNaN was true when it should have been false on full map start list limit setting.<\\/li>\\n<li>Updated geocoding functionality to start saving Place IDs when available.<\\/li>\\n<li>Updated over 1,000 locations AJAX method to use float values instead of decimals for latitude and longitude coordinates.<\\/li>\\n<li>Updated zooming to prevent fitBounds from being used when query string parameters are in use and the location has been set with bh-sl-address.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.1<\\/strong><\\/p>\\n<ul>\\n<li>Added cslRegion callback, which allows region to be set before being sent to the Google Maps Geocoding API.<\\/li>\\n<li>Fixed admin scripts loading on all WordPress dashboard pages and related post object error.<\\/li>\\n<li>Fixed issue where searching by location name after searching by address, without a new address, didn\'t reset the origin.<\\/li>\\n<li>Fixed incorrect origin marker parameter order after code restructure.<\\/li>\\n<li>Fixed single map issues with info window content when using alternate custom post type for location data.<\\/li>\\n<li>Updated single map script so that global marker overrides are applied when using the shortcode and widget.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.4.0<\\/strong><\\/p>\\n<ul>\\n<li>Added checks to make sure filter values are skipped in shortcode output if the value isn\'t set.<\\/li>\\n<li>Added checks to replace non-ASCII characters when filtering to prevent issues with special characters.<\\/li>\\n<li>Added city column to Locations edit pages (list view).<\\/li>\\n<li>Added cslCreateMarker JS callback for custom marker overrides.<\\/li>\\n<li>Added Disable alpha markers setting.<\\/li>\\n<li>Added functionality to accept manual coordinate overrides with latitude and longitude post meta.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/github.com\\/googlemaps\\/js-info-bubble\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">InfoBubble<\\/a> support.<\\/li>\\n<li>Added location results total count if HTML element with \\\"bh-sl-total-results\\\" class exists.<\\/li>\\n<li>Added map preview post meta box on single location edit screen with manual coordinate fine-tuning available.<\\/li>\\n<li>Added query string parameter filter check so that results can be filtered with URL query strings.<\\/li>\\n<li>Added reset functionality that can be triggered via a button that has the CSS class \\\"bh-sl-reset\\\".<\\/li>\\n<li>Added single location shortcode and widget to display map of a single location on single location posts.<\\/li>\\n<li>Added span and class to checkbox and radio button labels in filter output with shortcode.<\\/li>\\n<li>Fixed issue with Google Maps settings filter (bh_sl_map_settings) not being applied with full map start blank and no results.<\\/li>\\n<li>Fixed issue with Maximum Distance and Query string parameters settings combination.<\\/li>\\n<li>Updated Distance alert setting so that it can be disabled.<\\/li>\\n<li>Re-structured some of the underlying jQuery code.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.13<\\/strong><\\/p>\\n<ul>\\n<li>Fixed issue reading optional custom map styles file with WordPress installed in a subdirectory.<\\/li>\\n<li>Fixed issue where custom post meta with the same values were skipped from being included in the location data.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.12<\\/strong><\\/p>\\n<ul>\\n<li>Added array of term objects for location output to Handlebars templates for each custom taxonomy assigned to the locations post type.<\\/li>\\n<li>Added bh_sl_before_location_query and bh_sl_after_location_query hooks.<\\/li>\\n<li>Added cslMapSet callback that fires after the map has been set up.<\\/li>\\n<li>Added file existence and valid JSON checks to custom map styles file path setting.<\\/li>\\n<li>Changed method of reading custom map styles file from wp_remote_fopen to file_get_contents.<\\/li>\\n<li>Fixed issue where locations without attributes set (ex: custom meta fields) could get the attribute values from prior locations.<\\/li>\\n<li>Fixed issue where pagination total number of pages was based on the full location set total instead of the storeLimit setting.<\\/li>\\n<li>Reverted bh_storelocator_posts_query returning JSON vs. array for backwards compatibility.<\\/li>\\n<li>Updated included Handlebars to v4.0.5.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.11<\\/strong><\\/p>\\n<ul>\\n<li>Added additional JS error handling when the plugin checks the closest location.<\\/li>\\n<li>Added additional information about Google Maps API key, which is <a href=\\\"http:\\/\\/googlegeodevelopers.blogspot.com\\/2016\\/06\\/building-for-scale-updates-to-google.html\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">now required for all new URLs<\\/a>.<\\/li>\\n<li>Added fax meta field to default location post type.<\\/li>\\n<li>Added listener for autoComplete change so that the search processes when a new place is selected.<\\/li>\\n<li>Fixed issue with combination of autoGeocode and originMarker settings.<\\/li>\\n<li>Fixed PHP notices that would trigger on non-posts (no post ID) from enqueue_scripts in public class.<\\/li>\\n<li>Fixed zoom issue with Search on map drag setting.<\\/li>\\n<li>Switched city and address variables to triple stash in Handlebars templates to avoid issues with foreign characters.<\\/li>\\n<li>Updated admin class to delete locations transient when Primary Settings are saved to re-generate when Data Source is changed.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.10<\\/strong><\\/p>\\n<ul>\\n<li>Added optional Google Maps API key setting under Primary Settings.<\\/li>\\n<li>Added query string parameters string and key\\/val pair array to bh_sl_gmap filter.<\\/li>\\n<li>Fixed compatibility issue with WPML when using multiple domains.<\\/li>\\n<li>Fixed wp_enqueue_script deps parameters in a couple of instances.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.9<\\/strong><\\/p>\\n<ul>\\n<li>Fixed undefined JS issue with previous update.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.8<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to override data path and type with shortcode attributes datapath and datatype.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.7<\\/strong><\\/p>\\n<ul>\\n<li>Fixed issue with geocoding region parameter.<\\/li>\\n<li>Fixed issue with Full map start list limit default setting. Switched -1 default to 0.<\\/li>\\n<li>Updated Tested up to WordPress version to 4.5.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.6<\\/strong><\\/p>\\n<ul>\\n<li>Added check for WP_DEBUG to trigger jQuery plugin debug mode if enabled.<\\/li>\\n<li>Added post ID variable to bh_sl_location_data filter.<\\/li>\\n<li>Fixed issue with category marker images in which not setting a marker image could cause display issues with all markers.<\\/li>\\n<li>Updated Over 1,000 location query to use custom database table.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.5<\\/strong><\\/p>\\n<ul>\\n<li>Fixed geocode encoding issue with hashes in address fields.<\\/li>\\n<li>Fixed issue with geocode error handling.<\\/li>\\n<li>Minor WP_Query call optimizations.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.4<\\/strong><\\/p>\\n<ul>\\n<li>Fixed hard-coded postmeta prefixes in bh_storelocator_posts_query_ajax method.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.3<\\/strong><\\/p>\\n<ul>\\n<li>Exposed jQuery plugin callbacks.<\\/li>\\n<li>Removed check from createMarker method that removed spaces from categories - created issues with categories that have spaces.<\\/li>\\n<li>Re-worked handling of no results.<\\/li>\\n<li>Updated createMarker method to ensure custom category marker images are converted to integers if strings are passed for dimensions.<\\/li>\\n<li>Updated autoGeocode and default location functionality so that max distance is applied on initial load.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.2<\\/strong><\\/p>\\n<ul>\\n<li>Added custom location table row count to system information support tab.<\\/li>\\n<li>Fixed issue where custom category images weren\'t being output correctly to the jQuery plugin.<\\/li>\\n<li>Fixed issue in which 0 couldn\'t be saved as a setting value.<\\/li>\\n<li>Fixed issue with Location Category images where URLs weren\'t inserted when the the Link URL was empty.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.1<\\/strong><\\/p>\\n<ul>\\n<li>Added license check to avoid update issues after site migration and URL change.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.0<\\/strong><\\/p>\\n<ul>\\n<li>Added bh_sl_location_data filter so location data can be manipulated if needed.<\\/li>\\n<li>Added new Search on map drag setting under Primary Settings, which does a new search after the map is dragged.<\\/li>\\n<li>Added new Geocode button setting under Structure Settings, which allows you to bind a button to the HTML geolocation API.<\\/li>\\n<li>Changed postal code sanitization filter so that letters are allowed instead of just integers.<\\/li>\\n<li>Fixed pagination jQuery bubbling issue.<\\/li>\\n<li>Fixed pagination issues with autoGeocode combination.<\\/li>\\n<li>Fixed issues with Full map start list limit setting in combination with a different store limit.<\\/li>\\n<li>Fixed issues with no results where clicking the marker would display data from the previous result and clicking the location list item would throw an error.<\\/li>\\n<li>Fixed issues with Visible markers list setting and location list background colors and selection.<\\/li>\\n<li>Minor PHP formatting updates.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.2.1<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to override lat\\/lng coordinates with \'latitude\' and \'longitude\' meta keys with default CPT.<\\/li>\\n<li>Added excerpt to output location data.<\\/li>\\n<li>Added featured image URL to output location data.<\\/li>\\n<li>Added filter bh_sl_featured_img for output featured image URL size.<\\/li>\\n<li>Added functionality to output any custom taxonomy values applied to the location data (this also fixed filtering with other custom taxonomies).<\\/li>\\n<li>Added functionality to insert coordinates into database when using the WordPress Importer plugin.<\\/li>\\n<li>Fixed issue where post data wasn\'t being reset in enqueue_scripts method.<\\/li>\\n<li>Fixed missing argument warning in bh_storelocator_check_db_table method.<\\/li>\\n<li>Fixed Postal typo in post meta label.<\\/li>\\n<li>Removed extra wp_clear_scheduled_hook from bh-store-locator-db.php that was left in from testing.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.2.0<\\/strong><\\/p>\\n<ul>\\n<li>Set up a new method for handling over 1,000 location posts with a custom, indexed database table.<\\/li>\\n<li>Set up functionality to migrate existing coordinates into the new table with wp_cron.<\\/li>\\n<li>Newly added or updated location posts will now send coordinates to the custom table.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.1.1<\\/strong><\\/p>\\n<ul>\\n<li>Fixed JS issue with new full map start location list limit where clicking on a marker that didn\'t have a list item displayed caused an error.<\\/li>\\n<li>Fixed jQuery issue with settings combination of inline directions and default location.<\\/li>\\n<li>Reverted jQuery change to new list limit so that it\'s always applied with full map start enabled.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.1.0<\\/strong><\\/p>\\n<ul>\\n<li>Added new selected marker image options to highlight clicked marker under style settings.<\\/li>\\n<li>Added Google Places autocomplete option under primary settings.<\\/li>\\n<li>Added full map start location list limit setting under primary settings.<\\/li>\\n<li>Increased location data transient expiration.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.0.2<\\/strong><\\/p>\\n<ul>\\n<li>Added permalink to output location data for use in Handlebars templates.<\\/li>\\n<li>Switched Handlebars templates so that the name uses triple-stash because data is already escaped (special characters).<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.0.1<\\/strong><\\/p>\\n<p>Removed code that temporarily hid the map and results, when there are no results, in favor of just displaying the no\\u00a0results message and empty map.<\\/p>\\n\"]}\";}', 'no'),
(224, 'bh_storelocator_license_options', 'a:1:{s:11:\"license_key\";s:32:\"5d5a76bf319d60e44626bbf9e56dac53\";}', 'yes');
INSERT INTO `wp_options` (`option_id`, `option_name`, `option_value`, `autoload`) VALUES
(278, 'edd_sl_702f6653014699361aab96ba01e41f6c', 'a:2:{s:7:\"timeout\";i:1605166985;s:5:\"value\";s:41328:\"{\"new_version\":\"1.4.6\",\"stable_version\":\"1.4.6\",\"name\":\"Cardinal Locator Single License\",\"slug\":\"cardinal-locator\",\"url\":\"https:\\/\\/cardinalwp.com\\/downloads\\/cardinal-locator-single-license\\/?changelog=1\",\"last_updated\":\"2019-12-09 08:15:52\",\"homepage\":\"https:\\/\\/cardinalwp.com\",\"package\":\"https:\\/\\/cardinalwp.com\\/edd-sl\\/package_download\\/MTYwNTQxNTM4NTo1ZDVhNzZiZjMxOWQ2MGU0NDYyNmJiZjllNTZkYWM1MzozMzY6OTk2ZTM4NTgzMTY3YzVhYTcyMzhjOTI2MjZlMThhZjY6aHR0cEAvL2xvY2FsaG9zdC9zZW50ZWs6MA==\",\"download_link\":\"https:\\/\\/cardinalwp.com\\/edd-sl\\/package_download\\/MTYwNTQxNTM4NTo1ZDVhNzZiZjMxOWQ2MGU0NDYyNmJiZjllNTZkYWM1MzozMzY6OTk2ZTM4NTgzMTY3YzVhYTcyMzhjOTI2MjZlMThhZjY6aHR0cEAvL2xvY2FsaG9zdC9zZW50ZWs6MA==\",\"sections\":{\"description\":\"<p>Cardinal Store Locator is a WordPress plugin that gives customers the ability to add a fully functional locator to a WordPress website. It is built on top of the <a href=\\\"https:\\/\\/github.com\\/bjorn2404\\/jQuery-Store-Locator-Plugin\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">jQuery Store Locator plugin<\\/a> and offers all of the same features as the jQuery plugin along with a WordPress dashboard settings page, the ability to add locations as a custom post type or other data source of your choosing and set up filtering based on taxonomies. The plugin is aimed at developers with the amount of options and functionality available, but is accessible enough for non-developers to understand.<\\/p>\\n\",\"changelog\":\"<p><strong>1.4.6<\\/strong><\\/p>\\n<ul>\\n<li>Fixed missing CSS property .loc-alt-dist needed for front-end distance swap - both KM and miles show in templates without.<\\/li>\\n<li>Removed Geocoding API from being sent to the JS file (no longer publicly viewable in page source).<\\/li>\\n<li>Updated Handlebars templates so that location names are output with triple stash to avoid special character issues.<\\/li>\\n<li>Updated remote data caching functionality so that it\'s skipped completely if a relative URL is used for the Data file path setting.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.5<\\/strong><\\/p>\\n<ul>\\n<li>Added [cardinal-storelocator-address] shortcode to display single location address.<\\/li>\\n<li>Added bh_sl_locations_query_args filter to allow location WP_Query arguments to be updated\\/overridden.<\\/li>\\n<li>Added bh_sl_tax_cpts filter to allow the default \\\"Location Categories\\\" taxonomy to be applied to other post types.<\\/li>\\n<li>Added cslAjaxData callback to allow custom data to be sent with the AJAX request.<\\/li>\\n<li>Added cslAutoGeoSuccess callback that fires after the geolocation API returns a successful result.<\\/li>\\n<li>Added cslFormVals callback that fires after the form values have been processed from the form.<\\/li>\\n<li>Added cslGeocodeRestrictions callback that allows the componentRestrictions object to be overridden.<\\/li>\\n<li>Added cslNearestLoc callback that fires when the nearest location is triggered with the open nearest setting.<\\/li>\\n<li>Added cslSorting callback that fires when when a new sorting method is selected.<\\/li>\\n<li>Added component filtering for geocoding to better restrict by area - especially helpful with international geocoding.<\\/li>\\n<li>Added custom sorting settings under Structure Settings to allow visitors to control the location sort order from the front-end.<\\/li>\\n<li>Added drag and drop order functionality to filters set up under Filter Settings.<\\/li>\\n<li>Added functionality to specify filter types using the [cardinal-storelocator-filters] shortcode with the filter-types attribute.<\\/li>\\n<li>Added functionality to fill in search input with determined address when using Auto geocode or Geocode button settings.<\\/li>\\n<li>Added length unit (distance miles\\/kilometers) front-end swap functionality and settings.<\\/li>\\n<li>Added geocoding back-end API key field setting when Data source is set to Register Locations Post Type or Other Custom Post Type.<\\/li>\\n<li>Added Google Map object as parameter to cslBeforeSend, cslListClick, cslModalReady, and cslFilters callbacks.<\\/li>\\n<li>Added location data object as parameter of cslDirectionsRequest callback.<\\/li>\\n<li>Added mappingObject, originPoint, data, and page parameters to cslSuccess callback.<\\/li>\\n<li>Added \\\"No results alternative\\\" setting to display the no results message instead of all locations when the closest location is further than the \\\"Distance alert\\\" setting.<\\/li>\\n<li>Added open nearest location setting to automatically highlight the closest location from the origin.<\\/li>\\n<li>Changed parseJSON to native JSON.parse due to deprecation in rawData processing function.<\\/li>\\n<li>Fixed full path disclosure security issue with data passed to JavaScript.<\\/li>\\n<li>Fixed issue where HTML5 Geolocation was skipped when using the fullMapStartBlank setting.<\\/li>\\n<li>Fixed issue with featuredLocations setting where featured locations at far distances would trigger distance alert.<\\/li>\\n<li>Fixed issue with filtering values containing ampersands, which would not display any results - updated filtering regex.<\\/li>\\n<li>Fixed issue with mapReload (triggered with optional reset button) where store limit wasn\'t reset.<\\/li>\\n<li>Fixed issue with pagination page numbers displaying after no results.<\\/li>\\n<li>Fixed issue with taxonomy filtering and autoGeocode setting where HTML Geocoding API would run on every filter change.<\\/li>\\n<li>Fixed missing Google Maps API key parameter from post geocoding call.<\\/li>\\n<li>Fixed variable casting warning in PHP v7.1+ in shortcode file with wp_localize_script.<\\/li>\\n<li>Fixed typo in admin meta box container ID \\\"locations_meta_box\\\".<\\/li>\\n<li>Removed check for safe mode in plugin Support settings tab since it is deprecated as of PHP 5.4.0.<\\/li>\\n<li>Renamed EDD updater class to avoid conflicts with other themes and plugins.<\\/li>\\n<li>Removed locations transient (bh_sl_locations) expiration to default to none.<\\/li>\\n<li>Updated taxonomy filtering so pagination is reset to first page after selecting a filter.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.4<\\/strong><\\/p>\\n<ul>\\n<li>Hotfix to add now required key parameter to location post geocoding API call.<\\/li>\\n<li>This is just a quick fix - larger update with v1.4.5 coming very soon.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.3<\\/strong><\\/p>\\n<ul>\\n<li>Fixed error when filtering with query strings where filter values with spaces wouldn\'t work.<\\/li>\\n<li>Updated processForm method so submitting the map removes focus from any of the form input\\/select fields instead of just the address input.<\\/li>\\n<li>Updated filterData string replace methods to match string replace method in filters setup.<\\/li>\\n<li>Updated WPML path modification method so that it only is applied when \\\"A different domain per language\\\" is set as the language URL format.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.2<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to indicate multiple query string parameter values (for checkboxes) with a comma separated list value.<\\/li>\\n<li>Added additional hours meta fields for a total of seven to match days of the week.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/filters\\/plugin-assets-filter\\/\\\">bh_sl_page_check filter<\\/a> to disable locator scripts and styles on indicated pages.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/filters\\/taxonomy-filters-value-filter\\/\\\">bh_sl_filter_vals_\\\"taxonomy\\\" filter<\\/a> so filter values can be modified prior to output.<\\/li>\\n<li>Added blur to primary location input field after form submission to hide mobile keyboards.<\\/li>\\n<li>Added check to exclusive filtering to make sure filter values are not undefined before proceeding with the regular expression.<\\/li>\\n<li>Added disable autocomplete listener setting to disable the listener that immediately triggers a search when an auto complete location option is selected.<\\/li>\\n<li>Added functionality to automatically select\\/check filters on load from query string parameter values.<\\/li>\\n<li>Added location details object to <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/javascript-callbacks\\/location-list-click-callback\\/\\\">cslListClick<\\/a> and <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/javascript-callbacks\\/marker-click\\/\\\">cslMarkerClick<\\/a> callbacks.<\\/li>\\n<li>Added structure setting to disable form tags.<\\/li>\\n<li>Added template URI and stylesheet URI as available variables to Handlebars templates.<\\/li>\\n<li>Added WordPress REST API support for default locations custom post type (bh_sl_locations).<\\/li>\\n<li>Fixed broken drag search functionality that was introduced after map scope pull request was merged from jQuery plugin.<\\/li>\\n<li>Fixed geocoding issue when using an alternative custom post type for locations.<\\/li>\\n<li>Fixed Handlebars targeting issue triggered by placing an unordered list within the location list template.<\\/li>\\n<li>Fixed issue with full map start where conditional was checking if isNaN was true when it should have been false on full map start list limit setting.<\\/li>\\n<li>Updated geocoding functionality to start saving Place IDs when available.<\\/li>\\n<li>Updated over 1,000 locations AJAX method to use float values instead of decimals for latitude and longitude coordinates.<\\/li>\\n<li>Updated zooming to prevent fitBounds from being used when query string parameters are in use and the location has been set with bh-sl-address.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.1<\\/strong><\\/p>\\n<ul>\\n<li>Added cslRegion callback, which allows region to be set before being sent to the Google Maps Geocoding API.<\\/li>\\n<li>Fixed admin scripts loading on all WordPress dashboard pages and related post object error.<\\/li>\\n<li>Fixed issue where searching by location name after searching by address, without a new address, didn\'t reset the origin.<\\/li>\\n<li>Fixed incorrect origin marker parameter order after code restructure.<\\/li>\\n<li>Fixed single map issues with info window content when using alternate custom post type for location data.<\\/li>\\n<li>Updated single map script so that global marker overrides are applied when using the shortcode and widget.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.4.0<\\/strong><\\/p>\\n<ul>\\n<li>Added checks to make sure filter values are skipped in shortcode output if the value isn\'t set.<\\/li>\\n<li>Added checks to replace non-ASCII characters when filtering to prevent issues with special characters.<\\/li>\\n<li>Added city column to Locations edit pages (list view).<\\/li>\\n<li>Added cslCreateMarker JS callback for custom marker overrides.<\\/li>\\n<li>Added Disable alpha markers setting.<\\/li>\\n<li>Added functionality to accept manual coordinate overrides with latitude and longitude post meta.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/github.com\\/googlemaps\\/js-info-bubble\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">InfoBubble<\\/a> support.<\\/li>\\n<li>Added location results total count if HTML element with \\\"bh-sl-total-results\\\" class exists.<\\/li>\\n<li>Added map preview post meta box on single location edit screen with manual coordinate fine-tuning available.<\\/li>\\n<li>Added query string parameter filter check so that results can be filtered with URL query strings.<\\/li>\\n<li>Added reset functionality that can be triggered via a button that has the CSS class \\\"bh-sl-reset\\\".<\\/li>\\n<li>Added single location shortcode and widget to display map of a single location on single location posts.<\\/li>\\n<li>Added span and class to checkbox and radio button labels in filter output with shortcode.<\\/li>\\n<li>Fixed issue with Google Maps settings filter (bh_sl_map_settings) not being applied with full map start blank and no results.<\\/li>\\n<li>Fixed issue with Maximum Distance and Query string parameters settings combination.<\\/li>\\n<li>Updated Distance alert setting so that it can be disabled.<\\/li>\\n<li>Re-structured some of the underlying jQuery code.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.13<\\/strong><\\/p>\\n<ul>\\n<li>Fixed issue reading optional custom map styles file with WordPress installed in a subdirectory.<\\/li>\\n<li>Fixed issue where custom post meta with the same values were skipped from being included in the location data.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.12<\\/strong><\\/p>\\n<ul>\\n<li>Added array of term objects for location output to Handlebars templates for each custom taxonomy assigned to the locations post type.<\\/li>\\n<li>Added bh_sl_before_location_query and bh_sl_after_location_query hooks.<\\/li>\\n<li>Added cslMapSet callback that fires after the map has been set up.<\\/li>\\n<li>Added file existence and valid JSON checks to custom map styles file path setting.<\\/li>\\n<li>Changed method of reading custom map styles file from wp_remote_fopen to file_get_contents.<\\/li>\\n<li>Fixed issue where locations without attributes set (ex: custom meta fields) could get the attribute values from prior locations.<\\/li>\\n<li>Fixed issue where pagination total number of pages was based on the full location set total instead of the storeLimit setting.<\\/li>\\n<li>Reverted bh_storelocator_posts_query returning JSON vs. array for backwards compatibility.<\\/li>\\n<li>Updated included Handlebars to v4.0.5.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.11<\\/strong><\\/p>\\n<ul>\\n<li>Added additional JS error handling when the plugin checks the closest location.<\\/li>\\n<li>Added additional information about Google Maps API key, which is <a href=\\\"http:\\/\\/googlegeodevelopers.blogspot.com\\/2016\\/06\\/building-for-scale-updates-to-google.html\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">now required for all new URLs<\\/a>.<\\/li>\\n<li>Added fax meta field to default location post type.<\\/li>\\n<li>Added listener for autoComplete change so that the search processes when a new place is selected.<\\/li>\\n<li>Fixed issue with combination of autoGeocode and originMarker settings.<\\/li>\\n<li>Fixed PHP notices that would trigger on non-posts (no post ID) from enqueue_scripts in public class.<\\/li>\\n<li>Fixed zoom issue with Search on map drag setting.<\\/li>\\n<li>Switched city and address variables to triple stash in Handlebars templates to avoid issues with foreign characters.<\\/li>\\n<li>Updated admin class to delete locations transient when Primary Settings are saved to re-generate when Data Source is changed.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.10<\\/strong><\\/p>\\n<ul>\\n<li>Added optional Google Maps API key setting under Primary Settings.<\\/li>\\n<li>Added query string parameters string and key\\/val pair array to bh_sl_gmap filter.<\\/li>\\n<li>Fixed compatibility issue with WPML when using multiple domains.<\\/li>\\n<li>Fixed wp_enqueue_script deps parameters in a couple of instances.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.9<\\/strong><\\/p>\\n<ul>\\n<li>Fixed undefined JS issue with previous update.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.8<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to override data path and type with shortcode attributes datapath and datatype.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.7<\\/strong><\\/p>\\n<ul>\\n<li>Fixed issue with geocoding region parameter.<\\/li>\\n<li>Fixed issue with Full map start list limit default setting. Switched -1 default to 0.<\\/li>\\n<li>Updated Tested up to WordPress version to 4.5.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.6<\\/strong><\\/p>\\n<ul>\\n<li>Added check for WP_DEBUG to trigger jQuery plugin debug mode if enabled.<\\/li>\\n<li>Added post ID variable to bh_sl_location_data filter.<\\/li>\\n<li>Fixed issue with category marker images in which not setting a marker image could cause display issues with all markers.<\\/li>\\n<li>Updated Over 1,000 location query to use custom database table.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.5<\\/strong><\\/p>\\n<ul>\\n<li>Fixed geocode encoding issue with hashes in address fields.<\\/li>\\n<li>Fixed issue with geocode error handling.<\\/li>\\n<li>Minor WP_Query call optimizations.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.4<\\/strong><\\/p>\\n<ul>\\n<li>Fixed hard-coded postmeta prefixes in bh_storelocator_posts_query_ajax method.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.3<\\/strong><\\/p>\\n<ul>\\n<li>Exposed jQuery plugin callbacks.<\\/li>\\n<li>Removed check from createMarker method that removed spaces from categories - created issues with categories that have spaces.<\\/li>\\n<li>Re-worked handling of no results.<\\/li>\\n<li>Updated createMarker method to ensure custom category marker images are converted to integers if strings are passed for dimensions.<\\/li>\\n<li>Updated autoGeocode and default location functionality so that max distance is applied on initial load.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.2<\\/strong><\\/p>\\n<ul>\\n<li>Added custom location table row count to system information support tab.<\\/li>\\n<li>Fixed issue where custom category images weren\'t being output correctly to the jQuery plugin.<\\/li>\\n<li>Fixed issue in which 0 couldn\'t be saved as a setting value.<\\/li>\\n<li>Fixed issue with Location Category images where URLs weren\'t inserted when the the Link URL was empty.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.1<\\/strong><\\/p>\\n<ul>\\n<li>Added license check to avoid update issues after site migration and URL change.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.0<\\/strong><\\/p>\\n<ul>\\n<li>Added bh_sl_location_data filter so location data can be manipulated if needed.<\\/li>\\n<li>Added new Search on map drag setting under Primary Settings, which does a new search after the map is dragged.<\\/li>\\n<li>Added new Geocode button setting under Structure Settings, which allows you to bind a button to the HTML geolocation API.<\\/li>\\n<li>Changed postal code sanitization filter so that letters are allowed instead of just integers.<\\/li>\\n<li>Fixed pagination jQuery bubbling issue.<\\/li>\\n<li>Fixed pagination issues with autoGeocode combination.<\\/li>\\n<li>Fixed issues with Full map start list limit setting in combination with a different store limit.<\\/li>\\n<li>Fixed issues with no results where clicking the marker would display data from the previous result and clicking the location list item would throw an error.<\\/li>\\n<li>Fixed issues with Visible markers list setting and location list background colors and selection.<\\/li>\\n<li>Minor PHP formatting updates.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.2.1<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to override lat\\/lng coordinates with \'latitude\' and \'longitude\' meta keys with default CPT.<\\/li>\\n<li>Added excerpt to output location data.<\\/li>\\n<li>Added featured image URL to output location data.<\\/li>\\n<li>Added filter bh_sl_featured_img for output featured image URL size.<\\/li>\\n<li>Added functionality to output any custom taxonomy values applied to the location data (this also fixed filtering with other custom taxonomies).<\\/li>\\n<li>Added functionality to insert coordinates into database when using the WordPress Importer plugin.<\\/li>\\n<li>Fixed issue where post data wasn\'t being reset in enqueue_scripts method.<\\/li>\\n<li>Fixed missing argument warning in bh_storelocator_check_db_table method.<\\/li>\\n<li>Fixed Postal typo in post meta label.<\\/li>\\n<li>Removed extra wp_clear_scheduled_hook from bh-store-locator-db.php that was left in from testing.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.2.0<\\/strong><\\/p>\\n<ul>\\n<li>Set up a new method for handling over 1,000 location posts with a custom, indexed database table.<\\/li>\\n<li>Set up functionality to migrate existing coordinates into the new table with wp_cron.<\\/li>\\n<li>Newly added or updated location posts will now send coordinates to the custom table.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.1.1<\\/strong><\\/p>\\n<ul>\\n<li>Fixed JS issue with new full map start location list limit where clicking on a marker that didn\'t have a list item displayed caused an error.<\\/li>\\n<li>Fixed jQuery issue with settings combination of inline directions and default location.<\\/li>\\n<li>Reverted jQuery change to new list limit so that it\'s always applied with full map start enabled.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.1.0<\\/strong><\\/p>\\n<ul>\\n<li>Added new selected marker image options to highlight clicked marker under style settings.<\\/li>\\n<li>Added Google Places autocomplete option under primary settings.<\\/li>\\n<li>Added full map start location list limit setting under primary settings.<\\/li>\\n<li>Increased location data transient expiration.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.0.2<\\/strong><\\/p>\\n<ul>\\n<li>Added permalink to output location data for use in Handlebars templates.<\\/li>\\n<li>Switched Handlebars templates so that the name uses triple-stash because data is already escaped (special characters).<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.0.1<\\/strong><\\/p>\\n<p>Removed code that temporarily hid the map and results, when there are no results, in favor of just displaying the no\\u00a0results message and empty map.<\\/p>\\n\"},\"banners\":{\"high\":\"\",\"low\":\"\"},\"icons\":\"a:0:{}\",\"stable_tag\":\"trunk\",\"license\":\"GPLv3 or later\",\"license_uri\":\"http:\\/\\/www.gnu.org\\/licenses\\/gpl-3.0.html\",\"tested\":\"4.9\",\"description\":[\"<p>Cardinal Store Locator is a WordPress plugin that gives customers the ability to add a fully functional locator to a WordPress website. It is built on top of the <a href=\\\"https:\\/\\/github.com\\/bjorn2404\\/jQuery-Store-Locator-Plugin\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">jQuery Store Locator plugin<\\/a> and offers all of the same features as the jQuery plugin along with a WordPress dashboard settings page, the ability to add locations as a custom post type or other data source of your choosing and set up filtering based on taxonomies. The plugin is aimed at developers with the amount of options and functionality available, but is accessible enough for non-developers to understand.<\\/p>\\n\"],\"changelog\":[\"<p><strong>1.4.6<\\/strong><\\/p>\\n<ul>\\n<li>Fixed missing CSS property .loc-alt-dist needed for front-end distance swap - both KM and miles show in templates without.<\\/li>\\n<li>Removed Geocoding API from being sent to the JS file (no longer publicly viewable in page source).<\\/li>\\n<li>Updated Handlebars templates so that location names are output with triple stash to avoid special character issues.<\\/li>\\n<li>Updated remote data caching functionality so that it\'s skipped completely if a relative URL is used for the Data file path setting.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.5<\\/strong><\\/p>\\n<ul>\\n<li>Added [cardinal-storelocator-address] shortcode to display single location address.<\\/li>\\n<li>Added bh_sl_locations_query_args filter to allow location WP_Query arguments to be updated\\/overridden.<\\/li>\\n<li>Added bh_sl_tax_cpts filter to allow the default \\\"Location Categories\\\" taxonomy to be applied to other post types.<\\/li>\\n<li>Added cslAjaxData callback to allow custom data to be sent with the AJAX request.<\\/li>\\n<li>Added cslAutoGeoSuccess callback that fires after the geolocation API returns a successful result.<\\/li>\\n<li>Added cslFormVals callback that fires after the form values have been processed from the form.<\\/li>\\n<li>Added cslGeocodeRestrictions callback that allows the componentRestrictions object to be overridden.<\\/li>\\n<li>Added cslNearestLoc callback that fires when the nearest location is triggered with the open nearest setting.<\\/li>\\n<li>Added cslSorting callback that fires when when a new sorting method is selected.<\\/li>\\n<li>Added component filtering for geocoding to better restrict by area - especially helpful with international geocoding.<\\/li>\\n<li>Added custom sorting settings under Structure Settings to allow visitors to control the location sort order from the front-end.<\\/li>\\n<li>Added drag and drop order functionality to filters set up under Filter Settings.<\\/li>\\n<li>Added functionality to specify filter types using the [cardinal-storelocator-filters] shortcode with the filter-types attribute.<\\/li>\\n<li>Added functionality to fill in search input with determined address when using Auto geocode or Geocode button settings.<\\/li>\\n<li>Added length unit (distance miles\\/kilometers) front-end swap functionality and settings.<\\/li>\\n<li>Added geocoding back-end API key field setting when Data source is set to Register Locations Post Type or Other Custom Post Type.<\\/li>\\n<li>Added Google Map object as parameter to cslBeforeSend, cslListClick, cslModalReady, and cslFilters callbacks.<\\/li>\\n<li>Added location data object as parameter of cslDirectionsRequest callback.<\\/li>\\n<li>Added mappingObject, originPoint, data, and page parameters to cslSuccess callback.<\\/li>\\n<li>Added \\\"No results alternative\\\" setting to display the no results message instead of all locations when the closest location is further than the \\\"Distance alert\\\" setting.<\\/li>\\n<li>Added open nearest location setting to automatically highlight the closest location from the origin.<\\/li>\\n<li>Changed parseJSON to native JSON.parse due to deprecation in rawData processing function.<\\/li>\\n<li>Fixed full path disclosure security issue with data passed to JavaScript.<\\/li>\\n<li>Fixed issue where HTML5 Geolocation was skipped when using the fullMapStartBlank setting.<\\/li>\\n<li>Fixed issue with featuredLocations setting where featured locations at far distances would trigger distance alert.<\\/li>\\n<li>Fixed issue with filtering values containing ampersands, which would not display any results - updated filtering regex.<\\/li>\\n<li>Fixed issue with mapReload (triggered with optional reset button) where store limit wasn\'t reset.<\\/li>\\n<li>Fixed issue with pagination page numbers displaying after no results.<\\/li>\\n<li>Fixed issue with taxonomy filtering and autoGeocode setting where HTML Geocoding API would run on every filter change.<\\/li>\\n<li>Fixed missing Google Maps API key parameter from post geocoding call.<\\/li>\\n<li>Fixed variable casting warning in PHP v7.1+ in shortcode file with wp_localize_script.<\\/li>\\n<li>Fixed typo in admin meta box container ID \\\"locations_meta_box\\\".<\\/li>\\n<li>Removed check for safe mode in plugin Support settings tab since it is deprecated as of PHP 5.4.0.<\\/li>\\n<li>Renamed EDD updater class to avoid conflicts with other themes and plugins.<\\/li>\\n<li>Removed locations transient (bh_sl_locations) expiration to default to none.<\\/li>\\n<li>Updated taxonomy filtering so pagination is reset to first page after selecting a filter.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.4<\\/strong><\\/p>\\n<ul>\\n<li>Hotfix to add now required key parameter to location post geocoding API call.<\\/li>\\n<li>This is just a quick fix - larger update with v1.4.5 coming very soon.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.3<\\/strong><\\/p>\\n<ul>\\n<li>Fixed error when filtering with query strings where filter values with spaces wouldn\'t work.<\\/li>\\n<li>Updated processForm method so submitting the map removes focus from any of the form input\\/select fields instead of just the address input.<\\/li>\\n<li>Updated filterData string replace methods to match string replace method in filters setup.<\\/li>\\n<li>Updated WPML path modification method so that it only is applied when \\\"A different domain per language\\\" is set as the language URL format.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.2<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to indicate multiple query string parameter values (for checkboxes) with a comma separated list value.<\\/li>\\n<li>Added additional hours meta fields for a total of seven to match days of the week.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/filters\\/plugin-assets-filter\\/\\\">bh_sl_page_check filter<\\/a> to disable locator scripts and styles on indicated pages.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/filters\\/taxonomy-filters-value-filter\\/\\\">bh_sl_filter_vals_\\\"taxonomy\\\" filter<\\/a> so filter values can be modified prior to output.<\\/li>\\n<li>Added blur to primary location input field after form submission to hide mobile keyboards.<\\/li>\\n<li>Added check to exclusive filtering to make sure filter values are not undefined before proceeding with the regular expression.<\\/li>\\n<li>Added disable autocomplete listener setting to disable the listener that immediately triggers a search when an auto complete location option is selected.<\\/li>\\n<li>Added functionality to automatically select\\/check filters on load from query string parameter values.<\\/li>\\n<li>Added location details object to <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/javascript-callbacks\\/location-list-click-callback\\/\\\">cslListClick<\\/a> and <a href=\\\"https:\\/\\/cardinalwp.com\\/documentation\\/javascript-callbacks\\/marker-click\\/\\\">cslMarkerClick<\\/a> callbacks.<\\/li>\\n<li>Added structure setting to disable form tags.<\\/li>\\n<li>Added template URI and stylesheet URI as available variables to Handlebars templates.<\\/li>\\n<li>Added WordPress REST API support for default locations custom post type (bh_sl_locations).<\\/li>\\n<li>Fixed broken drag search functionality that was introduced after map scope pull request was merged from jQuery plugin.<\\/li>\\n<li>Fixed geocoding issue when using an alternative custom post type for locations.<\\/li>\\n<li>Fixed Handlebars targeting issue triggered by placing an unordered list within the location list template.<\\/li>\\n<li>Fixed issue with full map start where conditional was checking if isNaN was true when it should have been false on full map start list limit setting.<\\/li>\\n<li>Updated geocoding functionality to start saving Place IDs when available.<\\/li>\\n<li>Updated over 1,000 locations AJAX method to use float values instead of decimals for latitude and longitude coordinates.<\\/li>\\n<li>Updated zooming to prevent fitBounds from being used when query string parameters are in use and the location has been set with bh-sl-address.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>1.4.1<\\/strong><\\/p>\\n<ul>\\n<li>Added cslRegion callback, which allows region to be set before being sent to the Google Maps Geocoding API.<\\/li>\\n<li>Fixed admin scripts loading on all WordPress dashboard pages and related post object error.<\\/li>\\n<li>Fixed issue where searching by location name after searching by address, without a new address, didn\'t reset the origin.<\\/li>\\n<li>Fixed incorrect origin marker parameter order after code restructure.<\\/li>\\n<li>Fixed single map issues with info window content when using alternate custom post type for location data.<\\/li>\\n<li>Updated single map script so that global marker overrides are applied when using the shortcode and widget.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.4.0<\\/strong><\\/p>\\n<ul>\\n<li>Added checks to make sure filter values are skipped in shortcode output if the value isn\'t set.<\\/li>\\n<li>Added checks to replace non-ASCII characters when filtering to prevent issues with special characters.<\\/li>\\n<li>Added city column to Locations edit pages (list view).<\\/li>\\n<li>Added cslCreateMarker JS callback for custom marker overrides.<\\/li>\\n<li>Added Disable alpha markers setting.<\\/li>\\n<li>Added functionality to accept manual coordinate overrides with latitude and longitude post meta.<\\/li>\\n<li>Added <a href=\\\"https:\\/\\/github.com\\/googlemaps\\/js-info-bubble\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">InfoBubble<\\/a> support.<\\/li>\\n<li>Added location results total count if HTML element with \\\"bh-sl-total-results\\\" class exists.<\\/li>\\n<li>Added map preview post meta box on single location edit screen with manual coordinate fine-tuning available.<\\/li>\\n<li>Added query string parameter filter check so that results can be filtered with URL query strings.<\\/li>\\n<li>Added reset functionality that can be triggered via a button that has the CSS class \\\"bh-sl-reset\\\".<\\/li>\\n<li>Added single location shortcode and widget to display map of a single location on single location posts.<\\/li>\\n<li>Added span and class to checkbox and radio button labels in filter output with shortcode.<\\/li>\\n<li>Fixed issue with Google Maps settings filter (bh_sl_map_settings) not being applied with full map start blank and no results.<\\/li>\\n<li>Fixed issue with Maximum Distance and Query string parameters settings combination.<\\/li>\\n<li>Updated Distance alert setting so that it can be disabled.<\\/li>\\n<li>Re-structured some of the underlying jQuery code.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.13<\\/strong><\\/p>\\n<ul>\\n<li>Fixed issue reading optional custom map styles file with WordPress installed in a subdirectory.<\\/li>\\n<li>Fixed issue where custom post meta with the same values were skipped from being included in the location data.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.12<\\/strong><\\/p>\\n<ul>\\n<li>Added array of term objects for location output to Handlebars templates for each custom taxonomy assigned to the locations post type.<\\/li>\\n<li>Added bh_sl_before_location_query and bh_sl_after_location_query hooks.<\\/li>\\n<li>Added cslMapSet callback that fires after the map has been set up.<\\/li>\\n<li>Added file existence and valid JSON checks to custom map styles file path setting.<\\/li>\\n<li>Changed method of reading custom map styles file from wp_remote_fopen to file_get_contents.<\\/li>\\n<li>Fixed issue where locations without attributes set (ex: custom meta fields) could get the attribute values from prior locations.<\\/li>\\n<li>Fixed issue where pagination total number of pages was based on the full location set total instead of the storeLimit setting.<\\/li>\\n<li>Reverted bh_storelocator_posts_query returning JSON vs. array for backwards compatibility.<\\/li>\\n<li>Updated included Handlebars to v4.0.5.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.11<\\/strong><\\/p>\\n<ul>\\n<li>Added additional JS error handling when the plugin checks the closest location.<\\/li>\\n<li>Added additional information about Google Maps API key, which is <a href=\\\"http:\\/\\/googlegeodevelopers.blogspot.com\\/2016\\/06\\/building-for-scale-updates-to-google.html\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">now required for all new URLs<\\/a>.<\\/li>\\n<li>Added fax meta field to default location post type.<\\/li>\\n<li>Added listener for autoComplete change so that the search processes when a new place is selected.<\\/li>\\n<li>Fixed issue with combination of autoGeocode and originMarker settings.<\\/li>\\n<li>Fixed PHP notices that would trigger on non-posts (no post ID) from enqueue_scripts in public class.<\\/li>\\n<li>Fixed zoom issue with Search on map drag setting.<\\/li>\\n<li>Switched city and address variables to triple stash in Handlebars templates to avoid issues with foreign characters.<\\/li>\\n<li>Updated admin class to delete locations transient when Primary Settings are saved to re-generate when Data Source is changed.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.10<\\/strong><\\/p>\\n<ul>\\n<li>Added optional Google Maps API key setting under Primary Settings.<\\/li>\\n<li>Added query string parameters string and key\\/val pair array to bh_sl_gmap filter.<\\/li>\\n<li>Fixed compatibility issue with WPML when using multiple domains.<\\/li>\\n<li>Fixed wp_enqueue_script deps parameters in a couple of instances.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.9<\\/strong><\\/p>\\n<ul>\\n<li>Fixed undefined JS issue with previous update.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.8<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to override data path and type with shortcode attributes datapath and datatype.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.7<\\/strong><\\/p>\\n<ul>\\n<li>Fixed issue with geocoding region parameter.<\\/li>\\n<li>Fixed issue with Full map start list limit default setting. Switched -1 default to 0.<\\/li>\\n<li>Updated Tested up to WordPress version to 4.5.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.6<\\/strong><\\/p>\\n<ul>\\n<li>Added check for WP_DEBUG to trigger jQuery plugin debug mode if enabled.<\\/li>\\n<li>Added post ID variable to bh_sl_location_data filter.<\\/li>\\n<li>Fixed issue with category marker images in which not setting a marker image could cause display issues with all markers.<\\/li>\\n<li>Updated Over 1,000 location query to use custom database table.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.5<\\/strong><\\/p>\\n<ul>\\n<li>Fixed geocode encoding issue with hashes in address fields.<\\/li>\\n<li>Fixed issue with geocode error handling.<\\/li>\\n<li>Minor WP_Query call optimizations.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.4<\\/strong><\\/p>\\n<ul>\\n<li>Fixed hard-coded postmeta prefixes in bh_storelocator_posts_query_ajax method.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.3<\\/strong><\\/p>\\n<ul>\\n<li>Exposed jQuery plugin callbacks.<\\/li>\\n<li>Removed check from createMarker method that removed spaces from categories - created issues with categories that have spaces.<\\/li>\\n<li>Re-worked handling of no results.<\\/li>\\n<li>Updated createMarker method to ensure custom category marker images are converted to integers if strings are passed for dimensions.<\\/li>\\n<li>Updated autoGeocode and default location functionality so that max distance is applied on initial load.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.2<\\/strong><\\/p>\\n<ul>\\n<li>Added custom location table row count to system information support tab.<\\/li>\\n<li>Fixed issue where custom category images weren\'t being output correctly to the jQuery plugin.<\\/li>\\n<li>Fixed issue in which 0 couldn\'t be saved as a setting value.<\\/li>\\n<li>Fixed issue with Location Category images where URLs weren\'t inserted when the the Link URL was empty.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.1<\\/strong><\\/p>\\n<ul>\\n<li>Added license check to avoid update issues after site migration and URL change.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.3.0<\\/strong><\\/p>\\n<ul>\\n<li>Added bh_sl_location_data filter so location data can be manipulated if needed.<\\/li>\\n<li>Added new Search on map drag setting under Primary Settings, which does a new search after the map is dragged.<\\/li>\\n<li>Added new Geocode button setting under Structure Settings, which allows you to bind a button to the HTML geolocation API.<\\/li>\\n<li>Changed postal code sanitization filter so that letters are allowed instead of just integers.<\\/li>\\n<li>Fixed pagination jQuery bubbling issue.<\\/li>\\n<li>Fixed pagination issues with autoGeocode combination.<\\/li>\\n<li>Fixed issues with Full map start list limit setting in combination with a different store limit.<\\/li>\\n<li>Fixed issues with no results where clicking the marker would display data from the previous result and clicking the location list item would throw an error.<\\/li>\\n<li>Fixed issues with Visible markers list setting and location list background colors and selection.<\\/li>\\n<li>Minor PHP formatting updates.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.2.1<\\/strong><\\/p>\\n<ul>\\n<li>Added ability to override lat\\/lng coordinates with \'latitude\' and \'longitude\' meta keys with default CPT.<\\/li>\\n<li>Added excerpt to output location data.<\\/li>\\n<li>Added featured image URL to output location data.<\\/li>\\n<li>Added filter bh_sl_featured_img for output featured image URL size.<\\/li>\\n<li>Added functionality to output any custom taxonomy values applied to the location data (this also fixed filtering with other custom taxonomies).<\\/li>\\n<li>Added functionality to insert coordinates into database when using the WordPress Importer plugin.<\\/li>\\n<li>Fixed issue where post data wasn\'t being reset in enqueue_scripts method.<\\/li>\\n<li>Fixed missing argument warning in bh_storelocator_check_db_table method.<\\/li>\\n<li>Fixed Postal typo in post meta label.<\\/li>\\n<li>Removed extra wp_clear_scheduled_hook from bh-store-locator-db.php that was left in from testing.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.2.0<\\/strong><\\/p>\\n<ul>\\n<li>Set up a new method for handling over 1,000 location posts with a custom, indexed database table.<\\/li>\\n<li>Set up functionality to migrate existing coordinates into the new table with wp_cron.<\\/li>\\n<li>Newly added or updated location posts will now send coordinates to the custom table.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.1.1<\\/strong><\\/p>\\n<ul>\\n<li>Fixed JS issue with new full map start location list limit where clicking on a marker that didn\'t have a list item displayed caused an error.<\\/li>\\n<li>Fixed jQuery issue with settings combination of inline directions and default location.<\\/li>\\n<li>Reverted jQuery change to new list limit so that it\'s always applied with full map start enabled.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.1.0<\\/strong><\\/p>\\n<ul>\\n<li>Added new selected marker image options to highlight clicked marker under style settings.<\\/li>\\n<li>Added Google Places autocomplete option under primary settings.<\\/li>\\n<li>Added full map start location list limit setting under primary settings.<\\/li>\\n<li>Increased location data transient expiration.<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.0.2<\\/strong><\\/p>\\n<ul>\\n<li>Added permalink to output location data for use in Handlebars templates.<\\/li>\\n<li>Switched Handlebars templates so that the name uses triple-stash because data is already escaped (special characters).<\\/li>\\n<\\/ul>\\n<p>&nbsp;<\\/p>\\n<p><strong>v1.0.1<\\/strong><\\/p>\\n<p>Removed code that temporarily hid the map and results, when there are no results, in favor of just displaying the no\\u00a0results message and empty map.<\\/p>\\n\"]}\";}', 'no'),
